import React from 'react';
import MovieList from './components/MovieList';
import NavBar from './components/NavBar';
import { BrowserRouter, Route } from 'react-router-dom';

const App = () => {
    return (
        <BrowserRouter>
        <div className="App">
            <NavBar />
           <Route path='/' component={MovieList} />
        </div>
        </BrowserRouter>
    );
}

export default App;
